<H1><A NAME="c2556"></A><SUP></SUP>Compiler Error C2556</H1>

<P class=dt><B>'identifier' : overloaded functions only differ by return type</B></P>

<P>The indicated overloaded functions had different return types but the same parameter list.</P>

<P>Each overloaded function must have a distinctly different formal parameter list.</P>
